eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   bioContent: () => (/* binding */ bioContent)\n/* harmony export */ });\nconst bioContent = `<div class=\"column\">\n  <p><strong>Luca Castro, Tegucigalpa, Honduras.</strong></p>\n  <p>Bachelor of Arts in Communication and Advertising with specialization in Audiovisual Production - Universidad Tecnolgica Centroamericana, Honduras. Master of Arts in Leadership in Creative Industries - Hochschule Darmstadt, Germany. Winner of the DAAD (German Academic Exchange Service) scholarship in 2018. Member of the Honduran Filmmakers Collective and Brown Girls Doc Mafia. She has been part of the apprentice program of Rise Up Animation United State (2020 - 2021).</p>\n  \n  <p>Former lecturer at the Universidad Tecnolgica Centroamericana, Tegucigalpa campus for the Animation and Interactive Design and Graphic Design careers. She has collaborated with clients in Honduras, Guatemala, United States, Puerto Rico, Germany, France, Trinidad and Tobago, Mexico, and United Kingdom. Her work focuses on digital illustration, art consulting and 2D animation. Co-founder of the Rec Nights project that sought to produce free live music sessions for Central American artists and Storylab, a platform that seeks to bring people closer to different narrative media through social networks.</p>\n\n  <p>She was a juror for the photography contest \"Yo soy esa sujeto: Mujeres Viviendo con Discapacidad\" (I am that subject: Women Living with Disabilities) of Grupo Sociedad Civil (2021). Jury of the First Lego Leage Honduras competition, organized by Honduras Stem Foundation (2024). Mentioned by Adobe Latin America in its section #MiercolesdeMujeresCreativas on Instagram (2022).</p>\n\n  <h2>Group Photographic Exhibitions</h2>\n  <ul>\n    <li>2021 - \"Art Fest\" Jacobs University - Bremen, Germany</li>\n    <li>2021 - \"Seeing with my eyes\" Honduran Women in Art, Honduras</li>\n  </ul>\n\n  <h2>Group Art Exhibitions</h2>\n  <ul>\n    <li>2022 - \"1000 Women in Art\", Museo del Antiguo Palacio de Garcia, Nuevo Leon, Mexico.</li>\n    <li>2022 - \"Explo/Gallery Art and Illustration, 2nd edition, Tegucigalpa, Honduras</li>\n    <li>2022 - 43rd International Festival of the New Latin American Cinema, Havana, Cuba</li>\n  </ul>\n\n  <h2>Publications</h2>\n  <p>El Protagonismo de la mujer como ilustradora - Woman Style Magazine, Mexico (2023)</p>\n</div> \n<div class=\"column\">\n    <img src=\"\" alt=\"Adult artist portrait\" />\n    <img src=\"\" alt=\"Child artist drawing\" />\n    <p>My work seeks to capture the sense of openness and wonder that we experienced in childhood but I also enjoy exploring the intrigue, the unknown and the spiritual in my creations. I seek to explore different fantasy worlds that undoubtedly contain elements of the collective imagination such as Studio Ghibli films, Disney and the anime of the nineties.</p>\n    <p>Although I mainly use digital media, my beginnings were with pencil and paper, to which I return occasionally.</p>\n    <p>I find inspiration in art, travel, books, music, objects, conversations and everyday moments. My goal is that my work transcends diverse artistic disciplines, formats and narrative media to explore all creative possibilities.</p>\n</div>`;\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./src/data/bioData.js\n");

